from PyQt5.QtCore                  import QByteArray
from PyQt5.QtGui                   import QPixmap
from PyQt5.QtGui                   import QIcon

"""*************************************************************************************************
****************************************************************************************************
*************************************************************************************************"""
def MQT_ICON(name):

    global IMAGES

    _barray = QByteArray()
    _barray_data = _barray.fromBase64(IMAGES[name].encode("utf-8"))

    #create pixmap from base64 data
    _pixmap = QPixmap ()
    _pixmap.loadFromData(_barray_data, "PNG")

    #create icon
    _icon  = QIcon()
    _icon.addPixmap(_pixmap)

    return _icon

"""*************************************************************************************************
****************************************************************************************************
*************************************************************************************************"""
def MQT_PIXMAP(name):

    global IMAGES

    _barray = QByteArray()
    _barray_data = _barray.fromBase64(IMAGES[name].encode("utf-8"))

    #create pixmap from base64 data
    _pixmap = QPixmap ()
    _pixmap.loadFromData(_barray_data, "PNG")

    return _pixmap

"""*************************************************************************************************
****************************************************************************************************
*************************************************************************************************"""

IMAGES = {
            'mqt'               : '',
            'refresh'           : '',
            'refresh_hover'     : '',
            'splash'            : '',
            'snapshot'          : '',
            'snapshot_hover'    : '',
            'default'           : '',
            'default_hover'     : '',
            }